import numpy as npimport pandas as pdimport matplotlib.pyplot as pltimport seaborn as snsdf = pd.read_csv('https://raw.githubusercontent.com/grbruns/cst383/master/College.csv', index_col=0)# 3 asns.scatterplot(x=df['F.Undergrad'], y=df['Expend'])# 3 bsns.scatterplot(x=df['F.Undergrad'], y=df['Outstate'])# 3 cdf['perc.accept'] = (100*df.Accept/df.Apps)df['perc.enroll'] = (100*df.Enroll/df.Accept)